public class third {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n=5;
		int i=1,j=1,count=1;
		for(i=1;i<=n;i++) {
			for(j=1;j<=n;j++)
			{
			if(count<10)
				System.out.print("0"+count+" ");
			else
				System.out.print(count+" ");
			count++;
			}
	
		System.out.println();
	
	
		
	}
	}

}
